import React, { useState } from 'react';
import './App.css';
import ReactDOM from 'react-dom'
import GenerateGarden from "./component/GenerateGarden";


function ThemeChoice(props) {
  const handleChange = event => {
    const value = event.currentTarget.value;
    props.updateTheme(value);
  }
  return (
    <div className="Theme">
      <select name="theme" defaultValue={props.theme} onChange={handleChange}>
        <option value="Plants">Plants(défault)</option>
        <option value="Emoticones">Emoticones</option>
        <option value="Weather">Weather</option>
      </select>
    </div>
  )
}

function Choice(props) {
  const handleChange = event => {
    const value = event.currentTarget.value;
    props.updateTheme(value);
  }
  return (
    <div className="Theme">
      <select name="theme" defaultValue={props.theme} onChange={handleChange}>
        <option value="Plants">Plants(défault)</option>
        <option value="Emoticones">Emoticones</option>
        <option value="Weather">Weather</option>
      </select>
    </div>
  )
}

function App() {
  return (
    <div className="App">
      <h1>My Emoji Garden</h1>
      <div className="Parametres">
        <div className="Speed">
          Speed:
          <select id="dropdown">
            <option value="twosec">2 seconds</option>
            <option value="fivesec">5 seconds</option>
            <option value="sevensec">7 seconds</option>
            <option value="tensec">10 seconds</option>
          </select>
        </div>
      </div>
      <div className="Score">
        <option value="icon1">icon1</option>
        <option value="icon2">icon2</option>
        <option value="icon3">icon3</option>
      </div>
      <GenerateGarden />
    </div>
  );
}

export default App;
